import React, { Component } from "react";

export default class DialogResult extends Component {
  constructor(props) {
    super(props);
    this.state = {
      showDialog: null,
    };
  }
  hiddenDialog = () => {
    this.props.hiddenDialog();
  };
  render() {
    let { result } = this.props;
    let WPM = Math.round(
      (result.correct + (result.correct + result.wrong) / 6) / 2
    );
    return (
      <div
        className={
          this.props.showDialog ? "dialog__result show" : "dialog__result"
        }
      >
        <div className="dialog__result__content">
          <span className="dialog__result__title">Result</span>
          <span className="dialog__result__wpm">{WPM}WPM</span>
          <span className="dialog__result__count">{result.count}</span>
          <span className="dialog__result__correct">{result.correct}</span>
          <span className="dialog__result__incorrect">{result.wrong}</span>
          <span>{result.stringInput}</span>
          <div className="dialog__result__action">
            <button
              onClick={() => this.hiddenDialog()}
              className="dialog__result__action__btn"
            >
              Ok
            </button>
          </div>
        </div>
      </div>
    );
  }
}
